<?php

namespace App\Controller\Api;

use App\Controller\Base\BaseApiController;
use App\Repository\AuthTokenRepository;
use App\Repository\FilesRepository;
use App\Repository\UserRepository;
use App\Services\File\FileServices;
use App\Services\File\UploaderServices;
use App\Services\User\TokenServices;
use App\Services\User\UserServices;
use Hshn\Base64EncodedFile\HttpFoundation\File\Base64EncodedFile;
use Hshn\Base64EncodedFile\HttpFoundation\File\UploadedBase64EncodedFile;
use Symfony\Component\HttpFoundation\File\UploadedFile;
use Symfony\Component\HttpFoundation\Request;
use Symfony\Component\HttpFoundation\Response;
use Symfony\Component\Routing\Annotation\Route;
use OpenApi\Annotations as OA;
use Nelmio\ApiDocBundle\Annotation\Security;
use Symfony\Component\Security\Core\Security as CoreSecurity;


class FileController extends BaseApiController
{

    /**
     * Загрузка файлов
     *
     * @Route("/api/file", name="api_file_upload", methods={"POST"})
     *
     * @OA\RequestBody(
     *   @OA\MediaType(
     *     mediaType="application/json",
     *     @OA\Schema(
     *       type="object",
     *       @OA\Property(property="filename", type="string", description="Имя файла", example="example.png"),
     *       @OA\Property(property="filetype", type="string", description="Тип файла (photo_profile | public_docs | private_docs)", example="photo_profile"),
     *       @OA\Property(property="filedata", type="string", description="Файл закодированный в base64", example="data:image/png;base64,"),
     *     )
     *   )
     * )
     *
     * @OA\Response(response=200, description="Файл успешно загружен")
     * @OA\Response(response=401, description="Необходима авторизация")
     * @OA\Response(response=403, description="Недопустимое разрешение файла")
     * @OA\Response(response=500, description="При создании файла произошла ошибка")
     *
     * @OA\Tag(name="file")
     * @Security(name="Bearer")
     */
    public function upload_action(
        Request $request,
        CoreSecurity $security,
        UploaderServices $uploaderServices,
        FileServices $fileServices
    ): Response {
        $base64Content = (string)$this->getJson($request, 'filedata');
        $filename = (string)$this->getJson($request, 'filename');
        $filetype = (string)$this->getJson($request, 'filetype');

        $uploaded = new UploadedBase64EncodedFile(new Base64EncodedFile($base64Content), $filename);

        if (!$uploaderServices->isValid($uploaded))
            return $this->jsonError(['filename' => 'Нельзя загрузить файл с таким расширением'], 403);

        if (!$fileServices->isTypeValid($filetype))
            return $this->jsonError(['filename' => 'Неизвестная группа файла'], 403);

        $is_image = $uploaderServices->isImage($uploaded);

        if ($fileServices->isTypeFile($filetype)) {
            return $this->jsonError(['filetype' => 'В данный тип нельзя загружать файлы'], 403);
        }

        // Валидация на картинку (проверка пикселей)
        if ($is_image) {
            $limit_sizes = FileServices::MAX_SIZES_PIXEL[$filetype];
            $min_size = $limit_sizes[0];
            $max_size = $limit_sizes[1];
            $image_size = $fileServices->getImageSize($uploaded);
            if (!$image_size)
                return $this->jsonError(['filename' => 'Файл не является изображением'], 403);

            if ($image_size[0] < $min_size || $image_size[1] < $min_size)
                return $this->jsonError(['filename' => 'Минимальный размер изображения ' . $min_size . ' пикселей'], 403);

            if ($image_size[0] > $max_size || $image_size[1] > $max_size)
                return $this->jsonError(['filename' => 'Максимальный размер изображения ' . $max_size . ' пикселей'], 403);

            if ($filetype == FileServices::TYPE_AVATAR && $image_size[0] != $image_size[1])
                return $this->jsonError(['filename' => 'Загрузите квадратное изображение профиля'], 403);
        }

        // Валидация на размер файла / картинки
        $file_size = $fileServices->getFileSize($uploaded);
        $limit_sizes = FileServices::MAX_SIZES[$filetype];
        $min_size = $limit_sizes[0];
        $max_size = $limit_sizes[1];

        if ($file_size < $min_size || $file_size < $min_size)
            return $this->jsonError(['filename' => 'Минимальный размер файла ' . $fileServices->filesizeFormat($min_size)], 403);

        if ($file_size > $max_size || $file_size > $max_size)
            return $this->jsonError(['filename' => 'Максимальный размер файла ' . $fileServices->filesizeFormat($max_size)], 403);


        $filename = $uploaderServices->upload($uploaded, $filetype);

        if ($filename) {
            $file = $fileServices->createFile($security->getUser(), $filename, $filetype, $is_image);

            return $this->jsonSuccess([
                'filename' => $filename,
                'filetype' => $filetype,
                'id' => $file->getId()
            ]);
        } else
            return $this->jsonError(['filename' => 'Произошла ошибка при загрузке файла'], 500);
    }

    /**
     * Удаление файлов
     *
     * @Route("/api/file", name="api_file_delete", methods={"DELETE"})
     *
     * @OA\RequestBody(
     *   @OA\MediaType(
     *     mediaType="application/json",
     *     @OA\Schema(
     *       type="object",
     *       @OA\Property(property="id", type="string", description="Идентификатор файла", example="1"),
     *     )
     *   )
     * )
     *
     * @OA\Response(response=200, description="Файл успешно удален")
     * @OA\Response(response=401, description="Необходима авторизация")
     * @OA\Response(response=403, description="Ошибка удаления файла")
     * @OA\Response(response=404, description="Файл отсутствует")
     *
     * @OA\Tag(name="file")
     * @Security(name="Bearer")
     */
    public function uploadDelete_action(
        Request $request,
        CoreSecurity $security,
        FilesRepository $filesRepository,
        FileServices $fileServices
    ): Response {
        $file_id = (int)$this->getJson($request, 'id');

        $file = $filesRepository->find($file_id);

        if ($file) {
            $file_user_id = $file->getUser()->getId();
            $user_id = $security->getUser()->getId();

            if ($file_user_id != $user_id)
                return $this->jsonError(['id' => 'Ошибка прав доступа'], 403);

            if ($file->getIsDeleted())
                return $this->jsonError(['id' => 'Файл уже удален'], 404);

            if ($fileServices->deleteFile($file))
                return $this->jsonSuccess();
            else
                return $this->jsonError(['id' => 'Ошибка при удалении файла'], 403);
        } else
            return $this->jsonError(['id' => 'Файл отсутствует'], 404);
    }
}
